import './App.css';

function App() {

  const people = [{
    name: "Emily",
    bans: 3
  }, {
    name: "Rifa",
    bans: 0
  }];

  const handlePress = () => {
    alert('Button Pressed!');
  };

  const person = (name, bans) => {

    return (
      <div>
        <p>{name} has {bans}</p>
        <button className="my-button" onClick={handlePress}>
          Press Me
        </button>
      </div>
    );
  };


  return (
    <div className="App">
      {people.map((personData) => person(personData.name, personData.bans))}
